    }else if(screen.height <=1100){
        fonttitle = 18;
    }else if(screen.height <=1500){
        fonttitle = 30;
    }else if(screen.height <= 2200){
        fonttitle = 45;
    }

    var options = {
        responsive: true,
        maintainAspectRatio: false,
        elements: {
            point:{
