    myChart = new Chart(canvasCtx, {
        type: 'line',
        data: chartData,
        options: options,
    });

    ctx = document.getElementById("myArrow").getContext("2d");
    function Line(x1,y1,x2,y2){
        this.x1=x1;
        this.y1=y1;
        this.x2=x2;
        this.y2=y2;
    }
    Line.prototype.drawWithArrowheadv=function(ctx){
        // arbitrary styling
        ctx.strokeStyle="#c0c0c0";
        ctx.fillStyle="#c0c0c0";
        ctx.lineWidth=3;
        // draw the line
        ctx.beginPath();
        ctx.moveTo(this.x1,this.y1);
        ctx.lineTo(this.x2,this.y2);
        ctx.stroke();

        var startRadians=Math.atan((this.y2-this.y1)/(this.x2-this.x1));
        startRadians+=((this.x2>this.x1)?-90:90)*Math.PI/180;
        this.drawArrowhead(ctx,this.x2,this.y2,startRadians);//v
    }
        Line.prototype.drawWithArrowheadh=function(ctx){
        // arbitrary styling
        ctx.strokeStyle="#c0c0c0";
        ctx.fillStyle="#c0c0c0";
        ctx.lineWidth=3;
        // draw the line
        ctx.beginPath();
        ctx.moveTo(this.x1,this.y1);
        ctx.lineTo(this.x2,this.y2);
        ctx.stroke();

        var endRadians=Math.atan((this.y2-this.y1)/(this.x2-this.x1));
        endRadians+=((this.x2>this.x1)?90:-90)*Math.PI/180;
        this.drawArrowhead(ctx,this.x2,this.y2,endRadians); //h
    }
    Line.prototype.drawArrowhead=function(ctx,x,y,radians){
        ctx.save();
        ctx.beginPath();
        ctx.translate(x,y);
        ctx.rotate(radians);
        ctx.moveTo(0,0);
        ctx.lineTo(5,10); //size of arrowhead
        ctx.lineTo(-5,10);
        ctx.closePath();
        ctx.restore();
        ctx.fill();
    }
    var hline=new Line(9, document.getElementById("myArrow").height-10, document.getElementById("myArrow").width-10, document.getElementById("myArrow").height-10);//h adjust (v2,v3,v4)
    var vline=new Line(10, document.getElementById("myArrow").height-10, 10, document.getElementById("myArrow").height-120);//v adjust (v2)

    hline.drawWithArrowheadh(ctx);
    vline.drawWithArrowheadv(ctx);

    // console.log("arrow width:",document.getElementById("myArrow").width);
    // console.log("arrow height:",document.getElementById("myArrow").height);

    self.onResize;
}

self.onDataUpdated = function() {
    for (var i = 0; i < self.ctx.data.length; i++) {
        var datasourceData = self.ctx.data[i];
